import React from 'react';

function Sidebar() {
  return (
    <div className="sidebar">
      <h5>Sidebar</h5>
      <ul className="nav flex-column">
        <li className="nav-item">
          <a className="nav-link" href="#">Item 1</a>
        </li>
        <li className="nav-item">
          <a className="nav-link" href="#">Item 2</a>
        </li>
      </ul>
    </div>
  );
}

export default Sidebar;
